window.bookSummaryJSON = "<p><b>My role as Moric—ruler of a small and prosperous fiefdom in a quiet corner of the world—has always been painfully dull and stifling.</b></p> <p>Until a beautiful, otherworldly creature with pink skin and a mane of golden hair falls through a strange void that has appeared in my guestroom.</p> <p>I am instantly captivated by him.</p> <p>I have never seen anything like him. I have no idea where he came from, and what else is through that unsettling void—another world filled with soft-skinned, defenseless creatures like him? No tails, no horns, no claws, no sharp teeth. Tiny clothing, rounded ears, bright blue eyes. He is fascinating. And I want to keep him.</p> <p>I have no idea how my citizens and councilors will react to his presence—to the knowledge that a whole other world exists, and there is a portal to it in my guestroom. As much as I try to keep him my secret, the truth starts to slip out.</p> <p>Those in my fiefdom who cling desperately to power do their best to tear us apart. To take him from me.</p> <p>I won't let them.</p> <p><i>Lor</i> is book seven of the Monstrous series, a post-apocalyptic m/m fantasy series that features monsters and human men falling in love. It is best to listen to the series in order. Intended for mature listeners.</p>"; 
